import React from "react";
import Sidebar from "../components/shared/Sidebar";
import { useNavigate } from "react-router-dom";
import handleNavigate from "../helpers/handleNavigate";
import { useAuth } from "../features/auth/context/AuthContext";

const NewCampaigns = () => {
   const navigate = useNavigate();
   const { profile } = useAuth();
   return (
      <div className="bg-gradient-to-b from-[#F1FDFF] to-[#F5D9FF]">
         <Sidebar />
         <div className="mx-[288px] flex flex-col justify-center items-center h-screen">
            <div className="text-violet-800 text-2xl font-semibold leading-9 mb-6">
               Ready to start a new campaign?
            </div>
            <div className="w-[698px] h-[438px] flex-col justify-start items-center gap-5 inline-flex">
               <svg
                  width="368"
                  height="276"
                  viewBox="0 0 368 276"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                  xmlnsXlink="http://www.w3.org/1999/xlink">
                  <rect width="368" height="276" fill="url(#pattern0)" />
                  <defs>
                     <pattern
                        id="pattern0"
                        patternContentUnits="objectBoundingBox"
                        width="1"
                        height="1">
                        <use
                           xlinkHref="#image0_996_44053"
                           transform="matrix(0.00271739 0 0 0.00362319 0 -0.166667)"
                        />
                     </pattern>
                     <image
                        id="image0_996_44053"
                        width="368"
                        height="368"
                        xlinkHref="data:image/png;base64,"
                     />
                  </defs>
               </svg>

               <div className="flex-col justify-start items-center gap-1 flex">
                  <div className="text-center text-gray-900 text-2xl font-bold  leading-9">
                     Matchpoint AI makes it easier than ever.
                  </div>
                  <div className="w-[652px] text-center text-gray-900 text-xl font-normal leading-[30px]">
                     In just a few steps your content will be on it’s way.
                  </div>
               </div>
               <button
                  onClick={() =>
                     handleNavigate(profile?.id || "", "/campaign", navigate)
                  }
                  className="px-6 py-3.5 bg-indigo-700 rounded-lg justify-center items-center gap-2 inline-flex">
                  <svg
                     xmlns="http://www.w3.org/2000/svg"
                     width="17"
                     height="16"
                     viewBox="0 0 17 16"
                     fill="none">
                     <g clipPath="url(#clip0_2219_1271)">
                        <path d="M8.49935 8.0013H1.16602Z" fill="white" />
                        <path
                           d="M8.49935 0.667969V8.0013M8.49935 8.0013V15.3346M8.49935 8.0013H15.8327M8.49935 8.0013H1.16602"
                           stroke="white"
                           strokeWidth="2"
                           strokeLinecap="round"
                           strokeLinejoin="round"
                        />
                     </g>
                     <defs>
                        <clipPath id="clip0_2219_1271">
                           <rect
                              width="16"
                              height="16"
                              fill="white"
                              transform="translate(0.5)"
                           />
                        </clipPath>
                     </defs>
                  </svg>
                  <div className="text-white text-base font-medium leading-normal">
                     New Campaign
                  </div>
               </button>
            </div>
         </div>
      </div>
   );
};

export default NewCampaigns;
